import "../../Styles/Media-Queries.css";
import "../../Styles/main.css";

const Redes = ()=>{
    return(
        <div className="redes-container">
            <a href="https://github.com/Gehiner"><img src="https://i.ibb.co/6XDnmX0/logotipo-de-github.webp" alt="GitHub" /></a>
            <a href="https://www.linkedin.com/in/gehiner-ferley-sierra-rinc%C3%B3n-77106011b/"><img src="https://i.ibb.co/NxmFWfD/linkedin.webp" alt="LinkedIn" /></a>
            <a href=""><img src="https://i.ibb.co/Bn4gYNm/logotipo-circular-de-facebook.webp" alt="Facebook" /></a>
            <a href=""><img src="https://i.ibb.co/M8v9910/twitter.webp" alt="Twiter" /></a>
        </div>
    )
};

export default Redes;
